CompanyDealMaster.DealDescription:
Skillsoft Ltd has been awarded a contract by ManTech International Corporation to enhance employee career development and improve customer experience.


Contract Responsibilities:

Under the deal, Skillsoft Ltd will implement:

- Technology, Developer and Certification Solutions;
- online content library and intelligent learning experience platform, PERCIPIO;
- Digital Transformation Training;
- Skillsoft Leadership Development Program (SLDP);
- Skillsoft Compliance Solutions. 


Key Benefits:

The implementation is expected to:

- enable learning and training access, 24/7 through the Percipio Mobile App;
- support in attaining and maintaining certifications and training on software development and programming technologies, data analysis, security and leadership development;
- avail employees to access more than 30,000 multi-modal learning assets including courses, videos, books, audiobooks, TestPreps and Practice Labs;
- offer informed recommendations to learners.
